import ExpenseItem from "./components/ExpenseItem";

function App() {

  const Ex = [
    {
      count : 'Item 1',
      itemType : 'Food',
      expenditureLocation : 'Hyderabad',
      itemCost : 'Rs:200/-',
    },
    {
      count : 'Item 2',
      itemType : 'Petrol',
      expenditureLocation : 'Kakinada',
      itemCost : 'Rs:500/-',
    },
    {
      count : 'Item 3',
      itemType : 'Movies',
      expenditureLocation : 'Vijayawada',
      itemCost : 'Rs:100/-',
    },
    {
      count : 'Item 4',
      itemType : 'T-shirt',
      expenditureLocation : 'Vijayawada',
      itemCost : 'Rs:100/-',
    }
  ];

  return (
    <div>
      <h1>Let's get started!</h1>
      <h1>Expense items..</h1>
      <ExpenseItem
      ExpenseCount={Ex[0].count}
      ExpenseType={Ex[0].itemType}
      ExpenseLocation={Ex[0].expenditureLocation}
      ExpenseCost={Ex[0].itemCost} >
      </ExpenseItem>

      <ExpenseItem
      ExpenseCount={Ex[1].count}
      ExpenseType={Ex[1].itemType}
      ExpenseLocation={Ex[1].expenditureLocation}
      ExpenseCost={Ex[1].itemCost} >
      </ExpenseItem>

      <ExpenseItem
      ExpenseCount={Ex[2].count}
      ExpenseType={Ex[2].itemType}
      ExpenseLocation={Ex[2].expenditureLocation}
      ExpenseCost={Ex[2].itemCost} >
      </ExpenseItem>

      <ExpenseItem
      ExpenseCount={Ex[3].count}
      ExpenseType={Ex[3].itemType}
      ExpenseLocation={Ex[3].expenditureLocation}
      ExpenseCost={Ex[3].itemCost} >
      </ExpenseItem>
    </div>
  );
}

export default App;
